import React, { useEffect, useState } from "react";
import API from "../api";
import { useNavigate } from "react-router-dom";
import "./styles.css";

export default function ProductList() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [successMessage, setSuccessMessage] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    API.get("/products")
      .then((res) => {
        setProducts(res.data);
        setLoading(false);
      })
      .catch((err) => {
        console.error(err);
        setLoading(false);
      });
  }, []);

  const addToCart = async (productId, productName) => {
    try {
      await API.post("/cart", { productId, qty: 1 });
      setSuccessMessage(`âœ… ${productName} added to cart!`);
      setTimeout(() => setSuccessMessage(""), 3000);
    } catch (error) {
      console.error("Failed to add item to cart:", error);
      alert("Failed to add item to cart. Please try again.");
    }
  };

  if (loading) {
    return (
      <div className="products-page">
        <header className="products-header">
          <div className="header-content">
            <h1>Vibe Commerce</h1>
            <button className="cart-button" onClick={() => navigate("/cart")}>
              <span className="cart-icon">ðŸ›’</span>
              View Cart
            </button>
          </div>
        </header>

        <div className="products-container">
          <div className="page-header">
            <h2>Discover Products</h2>
            <p>Loading amazing products for you...</p>
          </div>

          <div className="products-grid">
            {[...Array(8)].map((_, index) => (
              <div key={index} className="product-card skeleton">
                <div className="skeleton-image"></div>
                <div className="skeleton-text short"></div>
                <div className="skeleton-text long"></div>
                <div className="skeleton-button"></div>
              </div>
            ))}
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="products-page">
      {/* Success Message */}
      {successMessage && (
        <div className="success-toast">
          <span className="toast-icon">âœ…</span>
          {successMessage}
        </div>
      )}

      <header className="products-header">
        <div className="header-content">
          <div className="brand">
            <span className="brand-icon">ðŸ›’</span>
            <h1>Vibe Commerce</h1>
          </div>
          <button className="cart-button" onClick={() => navigate("/cart")}>
            <span className="cart-icon">ðŸ›’</span>
            View Cart
            <span className="cart-badge">{products.length > 0 ? products.length : ''}</span>
          </button>
        </div>
      </header>

      <div className="products-container">
        <div className="page-header">
          <h2>Discover Products</h2>
          <p>Explore our curated collection of amazing products</p>
        </div>

        {products.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">ðŸ“¦</div>
            <h3>No products available</h3>
            <p>We're restocking our shelves. Check back soon for new arrivals!</p>
          </div>
        ) : (
          <div className="products-grid">
            {products.map((p) => (
              <div key={p.id} className="product-card">
                <div className="product-image-container">
                  <img 
                    src={p.image} 
                    alt={p.name}
                    className="product-image"
                    onError={(e) => {
                      e.target.src = 'https://via.placeholder.com/300x300/f5f5f5/666666?text=Product+Image';
                    }}
                  />
                  <div className="product-overlay">
                    <button 
                      className="quick-add-btn"
                      onClick={() => addToCart(p.id, p.name)}
                    >
                      + Add to Cart
                    </button>
                  </div>
                </div>

                <div className="product-info">
                  <h3 className="product-name">{p.name}</h3>
                  <p className="product-price">â‚¹{p.price}</p>
                  <button 
                    className="add-to-cart-btn"
                    onClick={() => addToCart(p.id, p.name)}
                  >
                    <span className="btn-icon">+</span>
                    Add to Cart
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}
